import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import User from './Components/user';
import Admin from './Components/admin';


function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/">
            <User />
          </Route>
          <Route path="/admin">
            <Admin />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
